let particles = [];
let flowers = [];


function setup() {
  colorMode(HSB, 100);
  createCanvas(396, 704);

  for (let i = 0; i < 20; i++) {
    flowers[i] = new Flowers(random(width), random(height), random(0.2, 0.5));
  }


  // generate particles

}

function draw() {
  background(255, 55);


  //rain
  if (particles.length < 500 ) {
    particles.push(
      new Particle(random(width), random(-height, 0), random(5, 40))
    );
  }

  for (let i = 0; i < 1; i++) {//splice
    if (particles[i].y > height) {
      particles.splice(i, 1);
    }
  }

  // update and display
  for (let i = 0; i < particles.length; i++) {
    let p = particles[i];
    p.verticalmove();
    //p.reappear();
    p.display();
  }

  for (let i = 0; i < 20; i++) {
    flowers.push (
      new Flowers(random(width), random(height), 0.01)
    );
  }
  for (let i = 0; i < 20; i++) {
      flowers[i].show();
      flowers[i].verticalmove();
      flowers[i].reappear();
    }





}



