    let d = dist(mouseX, mouseY, this.x, this.y);
    if (d < this.s / 2) {
      return true;
    } else {
      return false;
    }
  }

  bounce() {
    if (this.x < 0 || this.x > width) {
      this.speedX = -this.speedX;
    }
    if (this.y < 0 || this.y > height) {
      this.speedY = -this.speedY;
    }
  }
  colorChange(other) {
    // this.color = random(100);
    other.color = random(100);
  }
}

