function drawFloor() {
  push();
  let perspY = height * 0.3;
  let tileW = width/30;

  for (let x=-150; x <= width+150; x += tileW) {
    stroke(45);
    line(width/2, perspY, x, height);
  }
  let dy = 5;
  let y = height * 0.6;
  while (y <= height) {
    line(0, y, width, y);
    dy *= 1.05;
    y += dy;
  }

  fill(0);
  noStroke();
  beginShape();
